CREATE ALGORITHM=UNDEFINED DEFINER=`kind`@`%` SQL SECURITY DEFINER VIEW `v_sys_resources_visible` AS select `x0`.`RID` AS `rid`,`x0`.`TITLE` AS `title`,`x0`.`PARENTID` AS `parentid`,`x0`.`ALLORDIDX` AS `allordidx`,`x0`.`CHANNEL_RTYPE` AS `channel_rtype`,`x0`.`APP_ID` AS `app_id` from `sys_resources` `x0` where ((`x0`.`VISIBLE` <> 0) and (`x0`.`CHANNEL_RTYPE` = '00001') and exists(select 1 from `sys_resources` `x3` where ((`x3`.`VISIBLE` = 0) and (locate(`x3`.`ALLORDIDX`,`x0`.`ALLORDIDX`) > 0))) is false) union all select `x1`.`RID` AS `rid`,`x1`.`TITLE` AS `title`,`x1`.`PARENTID` AS `parentid`,`x1`.`ALLORDIDX` AS `allordidx`,`x1`.`CHANNEL_RTYPE` AS `channel_rtype`,`x1`.`APP_ID` AS `app_id` from `sys_resources` `x1` where ((`x1`.`CHANNEL_RTYPE` = '00002') and exists(select 1 from `sys_resources` `x4` where ((`x1`.`PARENTID` = `x4`.`RID`) and (`x1`.`VISIBLE` <> 0) and (`x4`.`CHANNEL_RTYPE` = '00001') and exists(select 1 from `sys_resources` `x5` where ((`x5`.`VISIBLE` = 0) and (locate(((0 <> ',') or (0 <> `x5`.`ALLORDIDX`)),((0 <> ',') or (0 <> `x1`.`ALLORDIDX`))) > 0))) is false))) union all select `x2`.`RID` AS `rid`,`x2`.`TITLE` AS `title`,`x2`.`PARENTID` AS `parentid`,`x2`.`ALLORDIDX` AS `allordidx`,`x2`.`CHANNEL_RTYPE` AS `channel_rtype`,`x2`.`APP_ID` AS `app_id` from `sys_resources` `x2` where (`x2`.`CHANNEL_RTYPE` not in ('00001','00002'));
