HANNEL_RTYPE` AS `channel_rtype` from (((`sys_n_user_dept_info` `x8` join `sys_n_role_department` `x9` on((`x8`.`DEPT_ID` = `x9`.`DEPT_ID`))) join `sys_n_rolerights` `x10` on((`x9`.`ROLEID` = `x10`.`ROLEID`))) join `sys_resources` `x11` on((`x10`.`RESOURCEID` = `x11`.`RID`)));
