n `sys_n_roles_dept_office` `c`) join `sys_n_roles_dept_office_rights` `d`) join `sys_department_type` `e`) where ((`a`.`DEPT_ID` = `b`.`DEPTID`) and (`e`.`DEPTID` = `a`.`DEPT_ID`) and (char(`e`.`BVALUE`) = `c`.`DEPT_TYPE`) and (`c`.`ROLEID` = `d`.`ROLEID`) and (`c`.`OFFICE_TYPE` is null)) union all select `d`.`RESOURCEID` AS `RESOURCEID`,`a`.`DEPT_ID` AS `DEPT_ID`,`a`.`OPNO` AS `OPNO`,`b`.`ORGANID` AS `ORGANID`,3 AS `FLAG` from (((`sys_n_user_dept_office_type` `a` join `sys_department_info` `b`) join `sys_n_roles_dept_office` `c`) join `sys_n_roles_dept_office_rights` `d`) where ((`a`.`DEPT_ID` = `b`.`DEPTID`) and (`c`.`ROLEID` = `d`.`ROLEID`) and (`c`.`DEPT_TYPE` is null) and (`c`.`OFFICE_TYPE` = `a`.`OFFICE_TYPE`));
